const column = [
  // phone_number,
  // work_position,
  // age,
  // salary,
  // email,
  // date
  {
    title: "Employee Info",
    children: [
      {
        title: " Name",
        dataIndex: "first_name",
        fixed: "left",
        sorter: (a, b) => a.first_name.length - b.first_name.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Last Name",
        dataIndex: "last_name",
        fixed: "left",
        onFilter: (value, record) => record.last_name.indexOf(value) === 0,
        sorter: (a, b) => a.last_name.length - b.last_name.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Gender",
        dataIndex: "gender",
        width: 200,
        filters: [
          {
            text: "Female",
            value: "female"
          },
          {
            text: "Male",
            value: "male"
          }
        ],
        filterMultiple: false,
        onFilter: (value, record) => record.gender.indexOf(value) === 0
      },
      {
        title: "Age",
        dataIndex: "age",
        sorter: (a, b) => a.age - b.age,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Address",
        dataIndex: "address",

        filters: [
          {
            text: "Huangpu",
            value: "Huangpu"
          },
          {
            text: "Changning",
            value: "Changning"
          },
          {
            text: "Jing'an",
