          },
          {
            text: "Baoshan",
            value: "Baoshan"
          },
          {
            text: "Jiading",
            value: "Jiading"
          },
          ,
          {
            text: "Pudong",
            value: "Pudong"
          },
          ,
          {
            text: "Jinshan",
            value: "Jinshan"
          },
          ,
          {
            text: "Songjiang",
            value: "Songjiang"
          },
          ,
          {
            text: "Qingpu",
            value: "Qingpu"
          },
          ,
          {
            text: "Fengxian",
            value: "Fengxian"
          },
          ,
          {
            text: "Chongming",
            value: "Chongming"
          }
        ],

        onFilter: (value, record) => record.address.indexOf(value) === 0,
        sorter: (a, b) => a.address.length - b.address.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Phone",
        dataIndex: "phone_number",

        sorter: (a, b) => a.phone_number.length - b.phone_number.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Position",
        dataIndex: "work_position",
        filters: [
          {
            text: "Chef",
            value: "Chef"
          },
          {
            text: "Waiter",
            value: "Waiter"
          },
          {
            text: "Manager",
            value: "Manager"
          },
          {
            text: "Cleaner",
            value: "Cleaner"
          }
        ],
        onFilter: (value, record) => record.work_position.indexOf(value) === 0
      },
      {
        title: "Salary",
        dataIndex: "salary",

        sorter: (a, b) => a.salary.length - b.salary.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Email",
        dataIndex: "email",

        sorter: (a, b) => a.email.length - b.email.length,
        sortDirections: ["descend", "ascend"]
      },
      {
        title: "Date",
        dataIndex: "date",
        sorter: (a, b) => a.date.length - b.date.length,
        sortDirections: ["descend", "ascend"]
      }
    ]
